import React, { useState } from 'react';
import { Button } from 'antd-mobile';

function Example() {
    const [count, setCount] = useState(0);
    return (
        <div>
            <p>You clicked {count} times</p>
            <Button>Start</Button>
            <button onClick={() => setCount(count + 1)}>Click me</button>
        </div>
   );
}

export default Example
